import React from 'react';
import TwitterIcon from '@material-ui/icons/Twitter';
import YouTubeIcon from '@material-ui/icons/YouTube';
import MailIcon from '@material-ui/icons/Mail';
import WhatsAppIcon from '@material-ui/icons/WhatsApp';
import GitHubIcon from '@material-ui/icons/GitHub';
import { blue, red, green, grey} from '@material-ui/core/colors';
import './App.scss';

const Footer = () => (
    <footer>
    <ul>
    <a href="https://www.facebook.com/" target="_blank" rel="noreferrer"><GitHubIcon fontSize="large" style={{ color: grey[900] }}/></a>
    <a href="https://twitter.com/" target="_blank" rel="noreferrer"><TwitterIcon fontSize="large" style={{ color: blue[500] }}/></a>
    <a href="https://www.youtube.com/" target="_blank" rel="noreferrer"><YouTubeIcon fontSize="large" style={{ color: red[800] }}/></a> 
    <a href="mailto:elcorreoquequieres@correo.com?Subject=Aquí%20el%20asunto%20del%20mail" rel="noreferrer"><MailIcon fontSize="large" style={{ color: grey[800]}}/></a>
    <a href="https://api.whatsapp.com/send?phone=5491161523456&text=Hola,%20qué%20tal?%20Me%20gustaría%20obtener%20mas%20información%20sobre%20sus%20productos" target="_blank" rel="noreferrer"><WhatsAppIcon style={{ color: green[600]}} fontSize="large" /></a> 
    </ul>
    </footer> 
)

export default Footer;
